import axios from 'axios'
import { useEffect, useState } from 'react'
import { Col, Row, Card, Button } from 'react-bootstrap'
import { Link } from 'react-router-dom'
import ItemCompSeller from './ItemCompSeller'
import LoginModal from './LoginModal'

const MyProduct = () => {

    const [product, setProduct] = useState('')

    useEffect(() => {
        GetMyProduct()
        console.log(product)
    }, [])

    const GetMyProduct = async () => {
        axios.get("/product/getbyuserid/" + localStorage.getItem('user_id'))
            .then(res => {
                setProduct(res.data)
                console.log(res.data)
            })
    }

    const dataList = product.filter((item, i) => (
        <Col md={3} >
            <div >
                <ItemCompSeller
                    itemTitle={item.product_name}
                    itemDesc={item.product_description}
                    itemImg={item.product_image}
                    itemSold={item.product_sold_amount}
                    itemId={item._id}
                    key={i}

                />
            </div >
        </Col>
    ))







    return (
        <div>
            <Card style={{ marginTop: 30, paddingTop: 10, paddingLeft: 10, paddingRight: 10 }}>
                <Card.Body >
                    <Card.Text>
                        <Link to="/addproduct">
                            <Button variant="outline-primary" >Add Product</Button>
                        </Link>
                    </Card.Text>
                    <Row >
                        {product != '' ? dataList : ''}
                    </Row>
                </Card.Body>
            </Card>
        </div>
    )
}
